import React, { Component } from 'react';
import styled from 'styled-components'

const Nav = styled.div`
padding: 16px;
width: 100%;
top: 0;
justify-content: center;
`
const Logo = styled.img`
height: 60px;
`

class App extends Component {
    render() {
        return (
            <div>
                <Nav class="sticky-top navbar navbar-expand-md navbar-light bg-transparent">
                    <div class="conjtainer">
                        <div class="collapse navbar-collapse" id="navbarNav">
                            <a href="#" class="navbar-brand">
                                <Logo class="logo" src="/static/img/Asset_10.svg" />
                            </a>
                            <span class="nav-item">
                                <a class="nav-link" href="#">คืออะไร</a>
                            </span>
                            <span class="nav-item">
                                <a class="nav-link" href="#">Pricing</a>
                            </span></div></div></Nav>
                okjoko
      </div>
        );
    }
}
export default App
